const BlogList = (props) => {
  const blogs = props.blogs;
  const title = props.title;
  return (
    <div className="blog-list">
      <h2></h2>
        {blogs.map(
            (blogs)=>(
                <div className="blog-preview" key={blogs.id}>
                    <h2>{blogs.title}</h2>
                    <p>Written by: {blogs.author}</p>
                </div>
        ))}
        </div>
  );
}

export default BlogList
